  }
  return (
       <>
   
      <div className='Nav'>
        
      <img src='/IMAGES/logo.png' width="82px"/>
      <ul>   
      <li><Link   to="/" style={linkStyle?{
        textDecoration: "none",
        color:"white",
        fontSize:20,
    }:{
        textDecoration: "none",
        color:"rgb(57 69 81)",
        fontSize:20,
     }} onMouseEnter={()=>{setLinkStyle(false)}}  onMouseLeave={()=>setLinkStyle(!linkStyle)} >Home</Link></li>
        
        
        <li><Link to=""  style={linkStyle1?{
        textDecoration: "none",
        color:"white",
        fontSize:20,
    }:{
        textDecoration: "none",
        color:"rgb(57 69 81)",
        fontSize:20,
     }} onMouseEnter={()=>{setLinkStyle1(false)}}  onMouseLeave={()=>setLinkStyle1(!linkStyle1)} onMouseEnter={Show} onMouseLeave={Hide}>Categories</Link></li>
       
       
        <li><Link to=""  style={linkStyle2?{
        textDecoration: "none",
        color:"white",
