        fontSize:20,
    }:{
        textDecoration: "none",
        color:"rgb(57 69 81)",
        fontSize:20,
     }} onMouseEnter={()=>{setLinkStyle3(false)}}  onMouseLeave={()=>setLinkStyle3(!linkStyle3)}>Contact</Link></li>
       
       
        <li><Link to=""  style={linkStyle4?{
        textDecoration: "none",
        color:"white",
        fontSize:20,
    }:{
        textDecoration: "none",
        color:"rgb(57 69 81)",
        fontSize:20,
    
        

     }} onMouseEnter={()=>{setLinkStyle4(false)}}  onMouseLeave={()=>setLinkStyle4(!linkStyle4)}>Latest </Link></li>
     </ul>
     </div>
    
    </>)
}

export default Navbar
